#define DX ((int32_t)(1 << (32 - LOG2_N)))
#define DX_MSK ((uint32_t)(DX - 1))
#define DX_RCP ((float)1.0 / DX)


#if (FIXPT_SINCOS_INTRPL_POLY)
/* Polynomial interpolation version */
float f32sin(int32_t x)
{
	float dy20;
	float dy21;
	float dy10;
	float y2;
	float y1;
	float y0;
	float y;
	float qx1;
	float qx0;
	int32_t dx1;
	int32_t dx0;
	int32_t i;

	i = x >> (32 - LOG2_N);

	y0 = qtab[i++][0];
	y1 = qtab[i++][0];
	y2 = qtab[i][0];

	dx0 = x & DX_MSK;
	dx1 = dx0 - DX;
	qx0 = dx0 * DX_RCP;
	qx1 = dx1 * DX_RCP;

	dy10 = (y1 - y0);
	dy21 = (y2 - y1);
	dy20 = (dy21 - dy10) / 2;

	y = y0 + qx0 * dy10 + qx0 * qx1 * dy20;

	return y;
}
#endif /* (FIXPT_SINCOS_INTRPL_POLY) */

#if (FIXPT_SINCOS_INTRPL_TRIG)
/* Circular interpolation version, using the trigonometric 
   identity: sin(a + b) = sin(a)*cos(b) + cos(a)*sin(b) 
*/
float f32sin(uint32_t x)
{
	float sin_x0;
	float cos_x0;
	float sin_fx0;
	float sin_fx1;
	float sin_fx;
	float cos_fx0;
	float cos_fx1;
	float cos_fx;
	int32_t dfx0;
	float qfx0;
	float y;
	uint32_t i;
	uint32_t j;

	i = (x >> (32 - LOG2_N));
	j = (x >> (32 - 2*LOG2_N)) & MASK_N;

	sin_x0 = qtab[i][0];
	cos_x0 = qtab[i][1];

	dfx0 = x & DFX_MSK;
	qfx0 = dfx0 * DFX_RCP;

	sin_fx0 = ftab[j][0];
	cos_fx0 = ftab[j][1];
	sin_fx1 = ftab[j + 1][0];
	cos_fx1 = ftab[j + 1][1];

	sin_fx = sin_fx0 + (sin_fx1 - sin_fx0) * qfx0;
	cos_fx = cos_fx0 + (cos_fx1 - cos_fx0) * qfx0;

	y = sin_x0 * cos_fx + cos_x0 * sin_fx;

	return y;
}
#endif /* (FIXPT_SINCOS_INTRPL_TRIG) */
